description.plain:
Texte écrit par Victor Hugo, issu du recueil posthume Toute la lyre publié en 1888.

La version originale contient deux strophes de cinq vers chacune.

Gainsbourg a supprimé deux vers, réarrangé ce qui reste et modifié le schéma métrique afin de le mettre en musique.

Voici ici le texte intégral de Victor Hugo :


Vous êtes bien belle et je suis bien laid.
A vous la splendeur de rayons baignée ;
A moi la poussière, à moi l'araignée.
Vous êtes bien belle et je suis bien laid ;
Soyez la fenêtre et moi le volet.

Nous réglerons tout dans notre réduit.
Je protégerai ta vitre qui tremble ;
Nous serons heureux, nous serons ensemble ;
Nous réglerons tout dans notre réduit ;
Tu feras le jour, je ferai la nuit.

